ExampleFirst we'll generate three responses to the same question to demonstrate the variability that is common to Chat Completion responses even when other parameters are the same:# Python```pythonimport osfrom openai import AzureOpenAIclient = AzureOpenAI(  azure_endpoint = os.getenv("AZURE_OPENAI_ENDPOINT"),   api_key=os.getenv("AZURE_OPENAI_API_KEY"),    api_version="2024-02-01")for i in range(3):  print(f'Story Version {i + 1}
---')      response = client.chat.completions.create(    model="gpt-35-turbo-0125", # Model = should match the deployment name you chose for your 0125-preview model deployment    #seed=42,    temperature=0.7,    max_tokens =50,     messages=[      {"role": "system", "content": "You are a helpful assistant."},      {"role": "user", "content": "Tell me a story about how the universe began?"}    ]  )    print(response.choices[0].message.content)  print("---
")    del response```# PowerShell```powershell-interactive$openai = @{   api_key     = $Env:AZURE_OPENAI_API_KEY   api_base    = $Env:AZURE_OPENAI_ENDPOINT # like the following https://YOUR_RESOURCE_NAME.openai.azure.com/   api_version = '2024-02-01' # may change in the future   name        = 'YOUR-DEPLOYMENT-NAME-HERE' # name you chose for your deployment}$headers = @{  'api-key' = $openai.api_key}$messages  = @()$messages += @{  role     = 'system'  content  = 'You are a helpful assistant.'}$messages += @{  role     = 'user'  content  = 'Tell me a story about how the universe began?'}$body         = @{  #seed       = 42  temperature = 0.7  max_tokens  = 50  messages    = $messages} | ConvertTo-Json$url = "$($openai.api_base)/openai/deployments/$($openai.name)/chat/completions?api-version=$($openai.api_version)"for ($i=0; $i -le 2; $i++) {  $response = Invoke-RestMethod -Uri $url -Headers $headers -Body $body -Method Post -ContentType 'application/json'  write-host "Story Version $($i+1)`n---`n$($response.choices[0].message.content)`n---`n"}```---### Output```outputStory Version 1---Once upon a time, before there was time, there was nothing but a vast emptiness. In this emptiness, there existed a tiny, infinitely dense point of energy. This point contained all the potential for the universe as we know it. And---Story Version 2---Once upon a time, long before the existence of time itself, there was nothing but darkness and silence. The universe lay dormant, a vast expanse of emptiness waiting to be awakened. And then, in a moment that defies comprehension, there---Story Version 3---Once upon a time, before time even existed, there was nothing but darkness and stillness. In this vast emptiness, there was a tiny speck of unimaginable energy and potential. This speck held within it all the elements that would come```Notice that while each story might have similar elements and some verbatim repetition the longer the response goes on the more they tend to diverge.Now we'll run the same code as before but this time uncomment the line for the parameter that says `seed=42`# Python```pythonimport osfrom openai import AzureOpenAIclient = AzureOpenAI(  azure_endpoint = os.getenv("AZURE_OPENAI_ENDPOINT"),   api_key=os.getenv("AZURE_OPENAI_API_KEY"),    api_version="2024-02-01")for i in range(3):  print(f'Story Version {i + 1}
---')      response = client.chat.completions.create(    model="gpt-35-turbo-0125", # Model = should match the deployment name you chose for your 0125-preview model deployment    seed=42,    temperature=0.7,    max_tokens =50,     messages=[      {"role": "system", "content": "You are a helpful assistant."},      {"role": "user", "content": "Tell me a story about how the universe began?"}    ]  )    print(response.choices[0].message.content)  print("---
")    del response```# PowerShell```powershell-interactive$openai = @{   api_key     = $Env:AZURE_OPENAI_API_KEY   api_base    = $Env:AZURE_OPENAI_ENDPOINT # like the following https://YOUR_RESOURCE_NAME.openai.azure.com/   api_version = '2024-02-01' # may change in the future   name        = 'YOUR-DEPLOYMENT-NAME-HERE' # name you chose for your deployment}$headers = @{  'api-key' = $openai.api_key}$messages  = @()$messages += @{  role     = 'system'  content  = 'You are a helpful assistant.'}$messages += @{  role     = 'user'  content  = 'Tell me a story about how the universe began?'}$body         = @{  seed        = 42  temperature = 0.7  max_tokens  = 50  messages    = $messages} | ConvertTo-Json$url = "$($openai.api_base)/openai/deployments/$($openai.name)/chat/completions?api-version=$($openai.api_version)"for ($i=0; $i -le 2; $i++) {  $response = Invoke-RestMethod -Uri $url -Headers $headers -Body $body -Method Post -ContentType 'application/json'  write-host "Story Version $($i+1)`n---`n$($response.choices[0].message.content)`n---`n"}```---### Output```Story Version 1---In the beginning, there was nothing but darkness and silence. Then, suddenly, a tiny point of light appeared. This point of light contained all the energy and matter that would eventually form the entire universe. With a massive explosion known as the Big Bang---Story Version 2---In the beginning, there was nothing but darkness and silence. Then, suddenly, a tiny point of light appeared. This point of light contained all the energy and matter that would eventually form the entire universe. With a massive explosion known as the Big Bang---Story Version 3---In the beginning, there was nothing but darkness and silence. Then, suddenly, a tiny point of light appeared. This was the moment when the universe was born.The point of light began to expand rapidly, creating space and time as it grew.---```By using the same `seed` parameter of 42 for each of our three requests, while keeping all other parameters the same, we're able to produce much more consistent results.> [!IMPORTANT]  > Determinism is not guaranteed with reproducible output. Even in cases where the seed parameter and `system_fingerprint` are the same across API calls it is currently not uncommon to still observe a degree of variability in responses. Identical API calls with larger `max_tokens` values, will generally result in less deterministic responses even when the seed parameter is set.
